input = [
"",
"",
"",
"",
""
]

#     1
#   2 3 4
# 5 6 7 8 9
#   A B C
#     D

for digit in input:
	pos = '5'
	for c in digit:
		pos = next(pos,c)
	print(pos)

def next(pos, move):
	walk_up = [['5'], ['A', '6', '2'], ['D', 'B', '7', '3', '1'], ['C', '8', '4'], ['9']]
	walk_down = [['5'], ['2', '6', 'A'], ['1', '3', '7', 'B', 'D'], ['4', '8', 'C'], ['9']]
	walk_right = [['1'], ['2', '3', '4'], ['5', '6', '7', '8', '9'], ['A', 'B', 'C'], ['D']]
	walk_left = [['1'], ['4', '3', '2'], ['9', '8', '7', '6', '5'], ['C', 'B', 'A'], ['D']]
	
	walk = []
	
	if (move == 'D') : walk = walk_down
	elif (move == 'U') : walk = walk_up
	elif (move == 'L') : walk = walk_left
	elif (move == 'R') : walk = walk_right
	
	for w in walk:
		if (pos in w):
			ind = w.index(pos)
			if (ind == len(w) - 1):
				return w[ind]
			else:
				return w[ind + 1]